import '../App.css';

function Machinetools(props) {
    

    return (
        <>
        <Box margin={{"top":"8%"}} width="xxlarge" background="light-4" pad="medium" gap="medium">
            <Box gap="small">
                <Box background="white" >
                <Heading margin="none" level="2" color="black">Digital agency</Heading><Heading margin="none" level="2" color="blue"> Service & Solutions</Heading>
                <Text color="dark-1" margin={{"top":"2%"}}>Our consultants opt in to the projects they genuinely want to work on.</Text>
                </Box>
            </Box>
        </Box>
            
        </>
    )
}
export default Machinetools;
